import { useEffect, useState } from "react";
import axios from "axios";

const UseCustomFetch = async(url) => {
    const [data, setData] = useState(null);
    useEffect(() => {
      axios.get(url)
        .then((data) => console.log(data));
    }, [url]);
  
    return data;
};
export default UseCustomFetch;
